import React from "react";

import "./footer.css";
import {Container, Row, Col, ListGroup, ListGroupItem} from "reactstrap";
import {Link} from "react-router-dom";
import logo1 from "../../assets/images/logo1.png";

const quick__links = [
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/about',
        display:'About'
    },
    {
        path:'/entreprises',
        display:'Services'
    },
];

const quick__links2 = [
    {
        path:'/login',
        display:'Login'
    },
    {
        path:'/register',
        display:'Register'
    },
];
const quick__links3 = [
    {
        path:'/restaurants',
        display:'Restaurants'
    },
    {
        path:'/pharmacies',
        display:'Pharmacies'
    },
    {
        path:'/cafes',
        display:'Cafes'
    },

    {
        path:'/travelagencies',
        display:'TravelAgencies'
    },
    {
        path:'/hotels',
        display:'Hotels'
    },
];


const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg="3">
                    
                        <div className="logo">
                            <img src={logo1} alt="" />
                            <p>
                            The company “Specialized Technical Editions, E.T.S.” is a private company, created in 1978 and whose main activity is the publication of the economic directory “Yellow Pages of Tunisia®” which includes all professional, industrial, commercial and craft activities.
                            </p>
                            <div className="social__links d-flex align-items-center gap-4">
                                <span>
                                    <Link to='#'> <i class="ri-facebook-circle-fill"></i></Link>
                                </span>
                            </div>
                        </div>
                        </Col>
                        <Col lg="3">
                            <h5 className="footer__link-title">Discover</h5>
                            <ListGroup className="footer__quick-links">
                                {quick__links.map((item,index) => (
                                    <ListGroupItem key={index} className="ps-0 border-0">
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))}
                            </ListGroup>
                        </Col>
                        <Col lg="3">
                        <h5 className="footer__link-title">Quick Links</h5>
                            <ListGroup className="footer__quick-links">
                                {quick__links2.map((item,index) => (
                                    <ListGroupItem key={index} className="ps-0 border-0">
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))}
                            </ListGroup>

                        </Col>
                        <Col lg="3">
                        <h5 className="footer__link-title">Activities</h5>
                            <ListGroup className="footer__quick-links">
                                {quick__links3.map((item,index) => (
                                    <ListGroupItem key={index} className="ps-0 border-0">
                                        <Link to={item.path}>{item.display}</Link>
                                    </ListGroupItem>
                                ))}
                            </ListGroup>
                        </Col>
                        <Col lg="3">
                        <h5 className="footer__link-title">Contact</h5>
                            <ListGroup className="footer__quick-links">
                                    <ListGroupItem key={index} className="ps-0 border-0 d-flex
                                    align-items-center gap-3"> 
                                    
                                    </ListGroupItem>
                            </ListGroup>
                        </Col>
                    
                </Row>
            </Container>
        </footer>

    );

};
export default Footer;
